import React from 'react'
import styled from 'styled-components'

const options = [
    {
        'name' : 'Category',
        'component' : 'Category',
    },
    {
        'name' : 'Description',
        'component' : 'Description',
    },
    {
        'name' : 'Location',
        'component' : 'Location',
    },
    {
        'name' : 'Benefits',
        'component' : 'Benefits',
    },
    {
        'name' : 'Intro Video',
        'component' : 'Intro_Video',
    },
    {
        'name' : 'Mentor Details',
        'component' : 'Mentor_Details',
    },
    {
        'name' : 'Recommended Roles',
        'component' : 'Recommended_Roles',
    },
    {
        'name' : 'Web Links & Resources',
        'component' : 'Resources',
    },
]

const modules = () => {
  return (
    <Wrapper className='col-12' >
        <Module className='col-12 col-md-6'></Module>
    </Wrapper>
  )
}

export default modules

const Wrapper = styled.div`

`

const Module = styled.div`

`

const ModuleItem = styled.div`
`
